package bbm.leetcode;

import java.util.HashMap;
import java.util.Map;
import java.util.concurrent.atomic.AtomicInteger;

/**
 * 实现 strStr() 函数。
 *
 * 给定一个 haystack 字符串和一个 needle 字符串，在 haystack 字符串中找出 needle 字符串出现的第一个位置 (从0开始)。如果不存在，则返回  -1。
 *
 * 示例 1:
 *
 * 输入: haystack = "hello", needle = "ll"
 * 输出: 2
 * 示例 2:
 *
 * 输入: haystack = "aaaaa", needle = "bba"
 * 输出: -1
 * 说明:
 *
 * 当 needle 是空字符串时，我们应当返回什么值呢？这是一个在面试中很好的问题。
 *
 * 对于本题而言，当 needle 是空字符串时我们应当返回 0 。这与C语言的 strstr() 以及 Java的 indexOf() 定义相符。
 *
 * 来源：力扣（LeetCode）
 * 链接：https://leetcode-cn.com/problems/implement-strstr
 *
 * @author bbm
 * @date 2020/5/22
 */
public class Question28 {
    public int strStr(String haystack, String needle) {
        if (needle == null || needle.length() == 0) {
            return 0;
        }
        if (needle.length() > haystack.length()) {
            return -1;
        }
        char first = needle.charAt(0);
        for (int i = 0; i < haystack.length(); i++) {
            if (haystack.charAt(i) != first) {
                for (; i < haystack.length() && haystack.charAt(i) != first; i++) {
                }
            }
            if (i >= haystack.length()) {
                return -1;
            }
            if (i + needle.length() > haystack.length()) {
                return -1;
            }
            if (haystack.charAt(i + needle.length() - 1) != needle.charAt(needle.length() - 1)) {
                continue;
            }
            boolean find = true;
            for (int j = 0; j < needle.length(); j++) {
                if ((i + j) >= haystack.length()) {
                    return -1;
                } else if (haystack.charAt(i + j) != needle.charAt(j)) {
                    find = false;
                    break;
                }
            }
            if (find) {
                return i;
            }
        }
        return -1;
    }

    /**
     * Slow
     */
    private int stateMachine(String haystack, String needle) {
        Map<Character, Integer> needleChars = new HashMap<>(needle.length() * 2);
        AtomicInteger index = new AtomicInteger(0);
        for (int i = 0; i < needle.length(); i++) {
            needleChars.computeIfAbsent(needle.charAt(i), (c) -> index.getAndIncrement());
        }
        int[][] table = new int[needle.length()][needleChars.size()];
        for (int i = 0; i < table.length; i++) {
            int rightIndex = needleChars.get(needle.charAt(i));
            table[i][rightIndex] = i + 1;
            String baseStr;
            if (i >= 1) {
                baseStr = needle.substring(1, i);
                int currentLevel = i;
                needleChars.forEach((character, indexOfCharacter) -> {
                    if (indexOfCharacter != rightIndex) {
                        String matchStr = baseStr + character;
                        while (matchStr.length() > 0) {
                            if (needle.startsWith(matchStr)) {
                                table[currentLevel][indexOfCharacter] = matchStr.length();
                                return;
                            } else {
                                matchStr = matchStr.substring(1);
                            }
                        }
                    }
                });
            }
        }
        int current = 0;
        for (int i = 0; i < haystack.length(); i++) {
            Integer charIndex = needleChars.get(haystack.charAt(i));
            if (charIndex == null) {
                current = 0;
            } else {
                current = table[current][needleChars.get(haystack.charAt(i))];
                if (current == needle.length()) {
                    return i + 1 - needle.length();
                }
            }
        }
        return -1;
    }

    public static void main(String[] args) {
        System.out.println(new Question28().strStr("", ""));
    }
}
